import removeIcon from '../assets/removeIcon.svg';

const RemoveButton = ({ onClick }) => {
    return (
            <img 
                className='absolute top-0 rounded-full z-10 bg-opacity-60
                    hover:cursor-pointer hover:bg-opacity-40 bg-black  
                    transition ease-in duration-150 ml-1 mt-1 p-2 h-9 w-9'
                onClick={onClick}
                src={removeIcon}
                alt=''
                />
    )
}

export default RemoveButton;
